import testimg from "../img/testimg.jpg";
import { Card } from 'antd';
import 'antd/dist/antd.css';







export default function Engajar() {
 return (
   <div className="fullpage0" style={{ backgroundImage: `url(${bg6})` }}>
     <div className='fp20'>
       <div className="heart"><img src={require('../img/img4.png')} /></div>

     </div>

   </div>   
 );
}
